import React from "react";

const Home = () => {
  return (
    <div>
      <div>
        <input type="text" placeholder="Name" />
        <input type="text" placeholder="Categories" />
        <input type="text" placeholder="Level" />
      </div>
      <div>
          <img src="logo192.png"/>
      </div>
    </div>
  );
};

export default Home;
